import { Header, List } from "semantic-ui-react"

const Movies = ({ movies }) => {
    return (
        <List>
            {movies.map(movie => {
                <List.Item key={movie.title}>
                    <Header>{movie.title}</Header>
                </List.Item>
            })}
        </List>
    )
}

export default Movies
